                    GoogleApiWrapper({apiKey: (AIzaSyBHLett8djBo62dDXj0EjCimF8Rd6E8cxg)}) ({
                    Austin: {lat: 30.2682, lng: -97.74295},
                    zoom: 8
                    })
                }
                <script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyBHLett8djBo62dDXj0EjCimF8Rd6E8cxg&callback=initMap"
                async defer></script>
            </div>
        )
    }
}

export default MapContainer;
